import React from 'react';

const Footer = () => {
  return (
    <footer className="mt-12 border-t border-white/10 bg-black/30 backdrop-blur">
      <div className="mx-auto max-w-6xl px-4 py-6 text-sm text-white/70 flex items-center justify-between">
        <p>© {new Date().getFullYear()} ExpenseTracker</p>
        <p className="text-white/60">Built with ❤️ and discipline</p>
      </div>
    </footer>
  );
};

export default Footer;
